INSERT INTO `laboratorios` VALUES (1,' 221133','Mantenimiento General','laboratorio','A6',23,21.00,'Alejandra Sandoval','activo','Herramientas manuales: destornilladores, llaves allen, alicates, pinzas. Herramientas eléctricas: taladro percutor, atornillador inalámbrico, esmeril angular. Instrumentos de medición: multímetro digital, calibrador vernier. Equipo de soldadura: estación de soldadura 60W, cautín. Mesa de trabajo con tornillo de banco, organizadores de herramientas, estantería metálica para repuestos y consumibles.','Uso obligatorio de EPP: gafas de seguridad, guantes de trabajo, calzado con puntera de acero. Verificar estado de herramientas antes de usar. Desconectar equipos eléctricos al terminar. Mantener área de trabajo limpia y libre de obstáculos. Prohibido operar maquinaria sin capacitación previa. Reportar herramientas defectuosas inmediatamente. Almacenar químicos y lubricantes en gabinete designado. Conocer ubicación de botiquín y extintores.','2025-10-10 16:34:15'),(2,'345567','Quimica General','laboratorio','A3',32,23.30,'Karen Perez','activo','Microscopios ópticos (10 unidades), Balanzas analíticas (5 unidades), \nCampana extractora de gases, Mecheros Bunsen (15 unidades), \nMaterial de vidrio (vasos, probetas, matraces), Agitadores magnéticos (8 unidades),\nCentrífuga de laboratorio, pH-metro digital, Espectrofotómetro UV-Vis','- Uso obligatorio de bata de laboratorio, gafas de seguridad y guantes\n- Prohibido comer, beber o fumar en el laboratorio\n- Mantener el área de trabajo limpia y ordenada\n- Conocer la ubicación de extintores, duchas de emergencia y lavaojos\n- Reportar inmediatamente cualquier derrame o accidente\n- Manipular reactivos químicos con precaución\n- Desechar residuos en contenedores apropiados\n- No trabajar solo en el laboratorio\n- Seguir las instrucciones del instructor en todo momento','2025-10-12 04:41:10');
